def combination(n, k):
    if k > n or k < 0:
        return 0
    return math.factorial(n) // (math.factorial(k) * math.factorial(n - k))

def verify_identity(n):
    # Left side: sum_{k=0}^{n} (-1)^k * C(n,k) * C(2n-k, n)
    left_side = 0
    for k in range(n + 1):
        term = ((-1) ** k) * combination(n, k) * combination(2*n - k, n)
        left_side += term

    # Right side: C(n, floor(n/2))
    right_side = combination(n, n // 2)

    return left_side == right_side

